definition:
Indication of the place where the agricultural raw materials of which the product is composed have been farmed, acc. To Council Regulation (EC) No 834/2007. It applies only to the trade item, not ingredient by ingredient. Where the Community logo is used, an indication of the place where the agricultural raw materials of which the product is composed have been farmed, shall also appear in the same visual field as the logo and shall take one of the code list forms, as appropriate. For EU or NON-EU indication, small quantities by weight of ingredients may be disregarded provided, that the total quantity of the disregarded ingredients does not exceed 2 % of the total quantity by weight of raw materials of agricultural origin. This Regulation shall apply to the following products originating from agriculture, including aquaculture, where such products are placed on the market or are intended to be placed on the market:
a) Live or unprocessed agricultural products;
b) Processed agricultural products for use as food;
c) Feed.;
d) Vegetative propagating material and seeds for cultivation.
The products of hunting and fishing of wild animals shall not be considered as organic production.
This Regulation shall also apply to yeasts used as food or feed.
